import React, { useState } from 'react';

const AnalyticsChart = () => {
    const [timeRange, setTimeRange] = useState('week');
    
    const chartData = {
        week: [65, 59, 80, 81, 56, 55, 40],
        month: [30, 45, 60, 75, 65, 80, 90, 85, 70, 65, 75, 80],
        year: [40, 45, 50, 55, 60, 65, 70, 75, 80, 85, 82, 78]
    };
    
    const currentData = chartData[timeRange];
    const maxValue = Math.max(...currentData);

    return (
        <div className="analytics-card glass">
            <div className="card-header">
                <h3>Performance Analytics</h3>
                <div className="time-filters">
                    {['week', 'month', 'year'].map(range => (
                        <button
                            key={range}
                            className={`time-filter ${timeRange === range ? 'active' : ''}`}
                            onClick={() => setTimeRange(range)}
                        >
                            {range.charAt(0).toUpperCase() + range.slice(1)}
                        </button>
                    ))}
                </div>
            </div>
            
            <div className="chart-container">
                <div className="chart">
                    {currentData.map((value, index) => (
                        <div key={index} className="chart-column">
                            <div 
                                className="chart-bar"
                                style={{ 
                                    height: `${(value / maxValue) * 100}%`
                                }}
                            ></div>
                            <div className="chart-label">
                                {timeRange === 'week' ? ['M', 'T', 'W', 'T', 'F', 'S', 'S'][index] :
                                 timeRange === 'month' ? index + 1 :
                                 ['J', 'F', 'M', 'A', 'M', 'J', 'J', 'A', 'S', 'O', 'N', 'D'][index]}
                            </div>
                        </div>
                    ))}
                </div>
            </div>
            
            <div className="chart-metrics">
                <div className="metric">
                    <div className="metric-value">12.5K</div>
                    <div className="metric-label">Page Views</div>
                </div>
                <div className="metric">
                    <div className="metric-value">68%</div>
                    <div className="metric-label">Engagement</div>
                </div>
                <div className="metric">
                    <div className="metric-value">2:45</div>
                    <div className="metric-label">Avg. Time</div>
                </div>
            </div>
        </div>
    );
};

export default AnalyticsChart;
